INSERT INTO `moderation_preset_action_messages` VALUES ('9', '2', 'Giveaway/sell/trade account', 'Do not attempt to or give away, sell, or trade your Habboon Hotel account and/or Habboon items for virtual items from another game, accounts from another game, cash, or vice versa without permission from an Administrator.', '0', '0', '0', '0', '');
